import React, { Component } from "react";

class App extends Component{
  render() {
    let a='About';
    return (
      <div>
            <nav className="navbar navbar-inverse">
            <a className="navbar-brand" >Title</a>
            <ul className="nav navbar-nav">
              <li className="active">
                <a >Home</a>
              </li>
              <li>
                <a >{a}</a>
              </li>
            </ul>
          </nav>
      </div>
    );
  };
};

export default App;
